	add("dragon", "{\"term\":\"dragon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"{{borrowing|fro|dragon|lang\u003den}}, from Latin {{m|la|dracō}}, from Ancient greek (to 1453) {{m|grc|δράκων||a serpent of huge size, a python, a dragon}}, probably from \u0027δρακεῖν\u0027 aorist active infinitive of {{m|grc|δέρκομαι||I see clearly}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A legendary serpentine or reptilian creature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In Western mythology, a gigantic beast, typically reptilian with leathery bat-like wings, lion-like claws, scaly skin and a serpent-like body, often a monster with fiery breath\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"s:The Last of the The Last of the Dragons\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"But as every well-brought-up prince was expected to kill a \u0027\u0027dragon\u0027\u0027, and rescue a princess, the \u0027\u0027dragons\u0027\u0027 grew fewer and fewer till it was often quite hard for a princess to find a dragon to be rescued from\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In Eastern mythology, a large, snake-like monster with the eyes of a hare, the horns of a stag and the claws of a tiger, usually beneficent\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, \u0027s:The Insidious Dr. Fu The Insidious Dr. Fu Manchu\u0027, chapter XIII\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"These tapestries were magnificently figured with golden \u0027\u0027dragons\u0027\u0027; and as the serpentine bodies gleamed and shimmered in the increasing radiance, each \u0027\u0027dragon\u0027\u0027, I thought, intertwined its glittering coils more closely with those of another\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An animal of various species that resemble a dragon in appearance\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A very large snake; a python\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Any of various agamid lizards of the genera \u0027Draco\u0027, \u0027Physignathus\u0027 or\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A Komodo dragon\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The constellation Draco\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1605\u0027\u0027, \u0027s:The Tragedy of King King Lear\u0027, Act I, Scene 2\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"My father compounded with my mother vnder the \u0027\u0027Dragons\u0027\u0027 taile, and my nativity was vnder \u0027Vrsa Maior\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"An unpleasant woman; a harridan\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"She’s a bit of a \u0027\u0027dragon\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The (historical) Chinese empire or the People\u0027s Republic of China\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Napoleon already warned of the awakening of \u0027\u0027the Dragon\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Something very formidable or dangerous\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A luminous exhalation from marshy ground, seeming to move through the air like a winged serpent\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A short musket hooked to a swivel attached to a soldier\u0027s belt; so called from a representation of a dragon\u0027s head at the muzzle\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A variety of carrier pigeon\", \"priority\":22}]}, \"synonyms\":{}}");

	add("dragonfly", "{\"term\":\"dragonfly\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|dragon|fly|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An insect of the suborder Epiprocta or, more strictly, the infraorder Anisoptera with four long transparent wings held perpendicular to a long body\", \"priority\":1}]}, \"synonyms\":{}}");

	add("dragonlore", "{\"term\":\"dragonlore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|dragon|lore|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The lore dealing with dragons\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, Paul Screeton, \u0027Quicksilver heritage: the mystic leys\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"speculations on astrology, astronomy, alchemy, unidentified flying objects, giantlore and \u0027\u0027dragonlore\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, Roger C. Schlobin, \u0027The Aesthetics of fantasy literature and art\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This form, which was inspired largely by Lord Dunsany in his \u0026quot;The Fortress Unvanquishable, Save for Sacnoth\u0026quot; and similar writings, combined the ancient materials of \u0027The Arabian Nights\u0027 with chivalric legend and \u0027\u0027dragonlore\u0027\u0027 of the North\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Joanna Hubbs, \u0027Mother Russia: The Feminine Myth in Russian Culture\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Indeed, the Russian contribution to \u0027\u0027dragonlore\u0027\u0027 is to be found in the clear connection made between the monster and the witch. The dragon appears to symbolize the winter and underworld nature of Yaga\", \"priority\":7}]}, \"synonyms\":{}}");

