	add("dragoon", "{\"term\":\"dragoon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|dragon|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A horse soldier; a cavalryman, who uses a horse for mobility, but fights dismounted\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"His forefathers had been, as a rule, professional men\u0026amp;mdash;physicians and lawyers; his grandfather died under the walls of Chapultepec Castle while twisting a tourniquet for a cursing \u0027\u0027dragoon\u0027\u0027; an uncle remained indefinitely at Malvern Hill\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A carrier of a dragon musket\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A variety of pigeon\", \"priority\":4}]}, \"synonyms\":{}}");

