	add("drainer", "{\"term\":\"drainer\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"Borrowing from English \u0027drain\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which drains\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Gail Waesche Kislevitz, \u0027The Spirit of the Marathon\u0027 (page 78\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I know that poor form is one of the biggest \u0027\u0027drainers\u0027\u0027 of energy, so even though I slowed down significantly I made a very conscious effort to maintain good form\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A frame or rack for allowing washed crockery etc to dry naturally\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person who explores drains, tunnels, and/or sewers\", \"priority\":5}]}, \"synonyms\":{}}");

