	add("drama", "{\"term\":\"drama\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) {{m|grc|δρᾶμα||an act, a theatrical act, a play}}, from {{m|grc|δράω||to act, to take action, to achieve}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A composition, normally in prose, telling a story and intended to be represented by actors impersonating the characters and speaking the dialogu\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Such a work for television, radio or the cinema (usually one that is not a comedy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Theatrical plays in genera\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A situation in real life that has the characteristics of such a theatrical pla\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Rumor, lying or exaggerated reaction to life events; melodrama; an angry dispute or scene; intrigue or spiteful interpersonal maneuvering\", \"priority\":5}]}, \"synonyms\":{}}");

	add("dramata", "{\"term\":\"dramata\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the Ancient greek (to 1453) \u0027δρᾱ́ματα\u0027 the nominative plural form of \u0027δρᾶμα\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"ante\u0027 1615\u0027\u0027, J.H.\u0026lt;sup\u0026gt;?\u0026lt;/sup\u0026gt;, \u0027\u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003d8b3L5xNvXokC\u0026amp;pg\u003dPA92\u0026amp;dq\u003ddramata\u0026amp;hl\u003den\u0026amp;ei\u003dZBZcTPSINIeN4gbB7tyRAg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d74\u0026amp;ved\u003d0COgDEOgBME\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003ddramata\u0026amp;f\u003dfalse This World’s Folly; or a Warning-Piece discharged upon the Wickedness thereof]\u0026lt;/span\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I will not particularize those Blitea \u0027\u0027dramata\u0027\u0027 (as Laberius tearmes another sort) those \u0027Fortune-fatted\u0027 fooles and Time’s Idoets, whose garbe is the Toothache of witte, the Plague-sore of Judgement, the Common-sewer of Obscœnitie, and the Traine-powder that dischargeth the roaring Meg of all scurrile villainies upon the Cities face; who are fain to produce blinde Impudence to personate himselfe upon their stage, behung with chaynes of garlicke, as an Antidote against their owne infectious breaths, lest it should kill their Oyster-crying Audience\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1692\u0027\u0027, w:Marcus Marcus Aurelius (Emperor of Rome) [author] and w:Méric Meric Caſaubon [translator], \u0027The Meditations of \u0027Marcus Aurelius Antoninus\u0027 the Roman Emperor, Concerning Himſelf\u0027, book X, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003donAPAAAAQAAJ\u0026amp;pg\u003dPA205\u0026amp;dq\u003ddramata\u0026amp;hl\u003den\u0026amp;ei\u003dZBZcTPSINIeN4gbB7tyRAg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d58\u0026amp;ved\u003d0CIADEOgBMD\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003ddramata\u0026amp;f\u003dfalse page 205]\u0026lt;/span\u0026gt;, § XXVII (5th edition; first published in 1634\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"XXVII. Ever to mind and conſider with thy ſelf, how all things that now are, have been heretofore much after the ſame ſort, and after the ſame faſhion that now they are: and ſo to think of thoſe things which ſhall be hereafter alſo. Moreover, whole \u0027\u0027\u0027dramata\u0027\u0027\u0027, and uniform ſcenes, [or, \u0027ſcenes that comprehend the lives and actions of men of one calling and profeſſion\u0027,]\u0026lt;!-- brackets sic --\u0026gt; as many as either in thine own experience thou haſt known, or by reading of ancient Hiſtories; (as the whole Court of \u0027Adrianus\u0027, the whole Court of \u0027Antoninus Pius\u0027, the whole Court of \u0027Philippus\u0027, that of \u0027Alexander\u0027, that of \u0027Crœſus:)\u0027\u0026lt;!-- colon and parenthesis italicised sic --\u0026gt; to ſet them all before thine eyes. For thou ſhalt find that they are all but after one ſort and faſhion: [or, \u0027all of the ſame kind and nature:\u0027]\u0026lt;!-- brackets and italicised colon sic --\u0026gt; onely that the actours were others\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1821\u0027\u0027, November 16th: w:Lord George Gordon Byron, 6th Baron Byron, \u0027\u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dSzp1n_bq_XkC\u0026amp;pg\u003dPA62\u0026amp;dq\u003ddramata\u0026amp;hl\u003den\u0026amp;ei\u003dZBZcTPSINIeN4gbB7tyRAg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d75\u0026amp;ved\u003d0CO4DEOgBME\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003ddramata\u0026amp;f\u003dfalse Letter to Douglas Kinnaird]\u0026lt;/span\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"“Cain” should be published in the same volume with the two other \u0027\u0027dramata\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Gregory Nagy and Anna Stavrakopoulou (editors), \u0027Modern Greek Literature: Critical Essays\u0027, chapter 1: Panagiotis A. Agapitos, “Ancient Models and Novel Mixtures: The Concept of Genre in Byzantine Funerary Literature from Photios to Eustathios of Thessalonike”, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dnvqfyjSyAz4C\u0026amp;pg\u003dPA14\u0026amp;dq\u003ddramata\u0026amp;hl\u003den\u0026amp;ei\u003dZBZcTPSINIeN4gbB7tyRAg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d35\u0026amp;ved\u003d0CPQBEOgBMC\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003ddramata\u0026amp;f\u003dfalse page 14]\u0026lt;/span\u0026gt\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"This is especially marked in the \u0027\u0027\u0027dramata\u0027\u0027\u0027 of Prodromos and Eugeneianos, which are composed, just like the poetic monodies we have seen, in iambic verse\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Peter Vorderer and Jennings Bryant (editors), \u0027Playing Video Games: Motives, Responses, and Consequences\u0027, chapter 26: Ute Ritterfeld and René Weber, “Video Games for Entertainment and Education”, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dwlX9wjhpPOYC\u0026amp;pg\u003dPA409\u0026amp;dq\u003ddramata\u0026amp;hl\u003den\u0026amp;ei\u003dZBZcTPSINIeN4gbB7tyRAg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d22\u0026amp;ved\u003d0CKQBEOgBMB\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003ddramata\u0026amp;f\u003dfalse page 409]\u0026lt;/span\u0026gt\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Recently, so-called \u0027pedagogical \u0027\u0027dramata\u0027\u0027\u0027 (e.g., Marsella, Johnson, \u0026amp; LaBore, 2003), which utilize interactive game play to teach successful communication strategies, were introduced. […] Similar to educational games, pedagogical \u0027\u0027dramata\u0027\u0027 pursue an explicit learning goal. […] Because the development of pedagogical \u0027\u0027dramata\u0027\u0027 is still in its very beginning, the technology has not yet been applied to less mature audiences[.]Category:English plurals ending in \u0026quot;-a\u0026quot\", \"priority\":15}]}, \"synonyms\":{}}");

