	add("drawbar", "{\"term\":\"drawbar\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|draw|bar|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An open-mouthed bar at the end of a car, which receives a coupling link and pin by which the car is drawn. It is usually provided with a spring to give elasticity to the connection between the cars of a train\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A bar of iron with an eye at each end, or a heavy link, for coupling a locomotive to a tender or car\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"road transport\u0027) A device to couple a powered road vehicle to a load to transfer tractive effort to the load, either as a push or as a pull. (See also w:Drawbar Wikipedia:Drawbar\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A sliding bar on a Hammond organ, controlling the volume of a waveform\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A device for changing the tools on milling machines\u0026lt;gallery\u0026gt;File:Drawbar trailer Drawbar for Drawbars on a Hammond organ.\u0026lt;/gallery\u0026gt\", \"priority\":5}]}, \"synonyms\":{}}");

